def white_black():
    qr = io.imread(r'some_qr.png')
    mass = []
    for i in range(0, 1040, 16):
        for j in range(0, 1040, 16):
            if np.mean(qr[i:i + 16, j:j + 16]) == 255:
                mass.append(1)
            else:
                mass.append(0)

    return (mass.count(1)), (mass.count(0))


